description:
YouTube is proud to present “Theater Kid Energy,” a love letter to musical theater inspired by the YouTube creators and comments that bring this community to life. @jordanfisher , @emilybearpiano , and @CalebHyles  join forces inside Lin-Manuel Miranda’s United Palace Theater for an original performance full of surprise cameos, iconic theater references, and some serious choreography. Let's get that theater kid energy! 

